import "./CreateCv.css";
const CreateCv = () => {
  return (
    <div className="container h-32 w-[30%] bg-[#262626] font-semibold m-6 text-white rounded-lg">
      <span className="self-start pr-5 ml-8 text-left ">CV Creator</span>
      <button type="button" className="focus:outline-none text-white shadow-2xl mr-2 bg-teal-600 mt-5 font-medium rounded-lg text-ms px-5 py-2.5 mb-2">Purple</button>
      <button type="button" className="focus:outline-none text-white shadow-2xl bg-teal-600 mt-5 font-medium rounded-lg text-ms px-5 py-2.5 mb-2">Purple</button>

    </div>
  );
};

export default CreateCv;
